/**
 * @param {string} s
 * @param {number} k
 * @return {number}
 */
var maxVowels = function(s, k) {
    const vowels = ['a', 'e', 'i', 'o', 'u'];
    let output = 0;
    for (let i = 0;  i <= s.length - k; i++) {
        let count = 0;
        let subStr = '';
        for (let j = i; j < i + k; j++) {
            subStr += s[j];
            if (vowels.includes(s[j])) {
                count++;
            }
        }
        output = Math.max(output, count);
    }
    return output;
};

